const API_PORT = parseInt(process.env.API_PORT) || 4000;
const API_HOST = process.env.API_HOST || "http://localhost"
const domain = API_HOST + ':' + API_PORT
export const routeConstants = {
    ADMIN_LOGIN : `${domain}/api/v1/man/login`
}
